import React from "react";
import Main from "./Components/Main/Main";
import * as Env from "./environments";
import Parse from "parse";

Parse.initialize(Env.APPLICATION_ID?.trim(), Env.JAVASCRIPT_KEY?.trim());
Parse.serverURL = Env.SERVER_URL?.trim();

function App() {
  return <Main />;
}

export default App;
